var FullCalendar=function(e){"use strict";var t=function(){function e(e,t){this.el=e,this.options=t||{},this.calendar=null}return e.prototype.render=function(){this.calendar&&this.calendar.destroy(),this.calendar=new FullCalendar.Calendar(this.el,this.options),this.calendar.render()},e.prototype.getApi=function(){return this.calendar},e}();return{Calendar:t}}({});

// Add basic calendar functionality
FullCalendar.Calendar.prototype.render=function(){
    this.el.innerHTML='<div class="fc-header-toolbar"><div class="fc-left"></div><div class="fc-center"></div><div class="fc-right"></div></div><div class="fc-view-container"></div>';
    this._renderHeader();
    this._renderView();
};

FullCalendar.Calendar.prototype._renderHeader=function(){
    var left=this.el.querySelector('.fc-left'),
        center=this.el.querySelector('.fc-center'),
        right=this.el.querySelector('.fc-right');
    
    // Add title
    center.innerHTML='<h2>'+this.getTitle()+'</h2>';
    
    // Add navigation buttons
    left.innerHTML='<button class="fc-prev-button">prev</button><button class="fc-next-button">next</button><button class="fc-today-button">today</button>';
    
    // Add view buttons
    right.innerHTML='<button class="fc-month-button">month</button><button class="fc-week-button">week</button><button class="fc-day-button">day</button>';
};

FullCalendar.Calendar.prototype._renderView=function(){
    var container=this.el.querySelector('.fc-view-container');
    container.innerHTML='<div class="fc-view"><div class="fc-content"></div></div>';
};

FullCalendar.Calendar.prototype.getTitle=function(){
    return 'Calendar';
};

// Export to global
window.FullCalendar=FullCalendar;
